import React, { Component } from "react";
import { BrowserRouter as Router, Switch } from "react-router-dom";
import { Home } from "./Home";
import { Aircrafts } from "./Aircrafts";
import { Airlines } from "./Airlines";
import { Airports } from "./Airports";
import { About } from "./About";
import { NoMatch } from "./NoMatch";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Router>
          <div>
            <Switch>
              <Route path="/">
                <Home />
              </Route>
              <Route path="/aircrafts">
                <Aircrafts />
              </Route>
              <Route path="/airlines">
                <airlines />
              </Route>
              <Route path="/airports">
                <Airports />
              </Route>
              <Route path="/about">
                <about />
              </Route>
              <Route >
                <NoMatch />
              </Route>

            </Switch>

            <Switch>
              <Router exact path="/" component={Home} />
              <Router path="/aircrafts" component={Aircrafts} />
              <Router path="/airlines" component={Airlines} />
              <Router path="/airports" component={Airports} />
              <Router path="/about" component={About} />
              <Router component={NoMatch} />
            </Switch>
          </div>
        </Router>
      </React.Fragment>
    );
  }
}

export default App;
